<script>


    function texform(x) {

        var t1 = "";

        t1 += '<tr class="nested-fields">';
        t1 += '<th><input type="hidden" data-id="' + x + '" name="docket[docket_items_attributes][_destroy][]" id="docket_docket_items_attributes_' + x + '__destroy" value="false"><a tabindex="-1" class="btn btn-sm close text-danger close-docket-item remove_fields dynamic" style="display:none;" href="#"></a>';

        t1 += '<input class="item_index"  data-id="' + x + '" type="hidden" name="docket[docket_items_attributes][item_index][]" id="docket_docket_items_attributes_' + x + '_item_index" value="1">';
        t1 += '<input class="string optional readonly form-control form-control-sm col-sm-12 awb"  data-id="' + x + '" tabindex="-1" style="width: 155px;" readonly="readonly" type="text" value="" name="docket[docket_items_attributes][awb][]" id="docket_docket_items_attributes_' + x + '_awb"></th>';
        t1 += '<th><input class="string optional readonly form-control form-control-sm col-sm-12 box_no"  data-id="' + x + '" value="" tabindex="-1" readonly="readonly" type="text" name="docket[docket_items_attributes][box_no][]" id="docket_docket_items_attributes_' + x + '_box_no"></th>';
        t1 += '<th><input class="string optional form-control form-control-sm col-sm-12 actual_weight tfc"  data-id="' + x + '" type="text" name="docket[docket_items_attributes][actual_weight][]" id="docket_docket_items_attributes_' + x + '_actual_weight"></th>';
        t1 += '<th><input class="string optional form-control form-control-sm l_b_h_width col-sm-12 length tfc"  data-id="' + x + '" type="text" name="docket[docket_items_attributes][length][]" id="docket_docket_items_attributes_' + x + '_length"></th>';
        t1 += '<th><input class="string optional form-control l_b_h_width form-control-sm col-sm-12 width tfc"  data-id="' + x + '" type="text" name="docket[docket_items_attributes][width][]" id="docket_docket_items_attributes_' + x + '_width"></th>';
        t1 += '<th><input class="string optional form-control l_b_h_width form-control-sm col-sm-12 height tfc"  data-id="' + x + '" type="text" name="docket[docket_items_attributes][height][]" id="docket_docket_items_attributes_' + x + '_height"></th>';
        t1 += '<th><input class="string optional readonly form-control form-control-sm col-sm-10 volume_weight"  data-id="' + x + '" tabindex="-1" readonly="readonly" type="text" name="docket[docket_items_attributes][volume_weight][]" id="docket_docket_items_attributes_' + x + '_volume_weight"></th>';
        t1 += '<th><input class="string optional readonly form-control form-control-sm col-sm-10 chargeable_weight"  data-id="' + x + '" tabindex="-1" readonly="readonly" type="text" name="docket[docket_items_attributes][chargeable_weight][]" id="docket_docket_items_attributes_' + x + '_chargeable_weight"></th>';

        t1 += '</tr>';


        return t1;
    }


    $('#docket_pcs').on('keyup', function () {
        var count = 1;
        var n = 0;
        let x = Math.floor((Math.random() * 1000) + 2555);

        var t2 = "";
        var t = $(".pcs-information .nested-fields:visible").length, e = $("#docket_pcs").val();
        if (parseInt(t) > parseInt(e)) {

            for (var n = parseInt(t); n > parseInt(e); n--) {
                $('.pcs-information tr:last').remove();

            }

        } else if (parseInt(t) < parseInt(e)) {
            for (n = 0; n < parseInt(e) - parseInt(t); n++) {
                x = Math.floor((Math.random() * 100000) + 255500);


                t2 = texform(x);

                $('.pcs-information').append(t2);
            }
        }


    });

    $(document).on('keyup', '.actual_weight', function () {
        var serial_no = [];
        var tr = $(".pcs-information .nested-fields:visible").length, e = $("#docket_pcs").val();
        for (var i = 0; i < tr; i++) {
            serial_no.push(i + 1);
        }


        $(".box_no").each(function (i) {
            $(this).val(serial_no[i]);

        })

        $(".awb").each(function (i) {
            $(this).val(serial_no[i]);
            $(this).val('<?=$randomNum . '0';?>' + serial_no[i]);

        })


    });

    $(document).on('keyup', '.length, .width, .height, .actual_weight', function () {

        var dataid = $(this).data('id');
        var weight = parseInt($("#docket_docket_items_attributes_" + dataid + "_actual_weight").val());
        var length = parseInt($("#docket_docket_items_attributes_" + dataid + "_length").val());
        var width = parseInt($("#docket_docket_items_attributes_" + dataid + "_width").val());
        var height = parseInt($("#docket_docket_items_attributes_" + dataid + "_height").val());

        var cal = (width * length * height) / 5000;


        $("#docket_docket_items_attributes_" + dataid + "_volume_weight").val(cal);

        var volumeWeight = parseFloat($("#docket_docket_items_attributes_" + dataid + "_volume_weight").val());
        var actualWeight = parseFloat($("#docket_docket_items_attributes_" + dataid + "_actual_weight").val());

        // alert(actualWeight);
        if (volumeWeight >= actualWeight) {

            $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(volumeWeight);


            var volumeWeightInt = parseInt(volumeWeight);


            if (volumeWeight <= 10) {

                if (volumeWeightInt >= volumeWeight) {
                    $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(volumeWeightInt);

                } else {
                    var actot = parseFloat(volumeWeight - volumeWeightInt);

                    if (actot < 0.501) {
                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(volumeWeight) + 0.5);
                    } else {
                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(volumeWeight + 0.5));

                    }

                }

            } else {

                if (volumeWeightInt >= volumeWeight) {
                    $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(volumeWeightInt);

                } else {


                    var actot = parseFloat(volumeWeight - volumeWeightInt);

                    if (actot < 0.999) {
                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(volumeWeightInt) + 1);
                    } else {
                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(volumeWeight + 1));

                    }

                }
            }


        } else {
            $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(actualWeight);

            var volumeWeightInt = parseInt(actualWeight);

            if (actualWeight <= 10) {


                if (volumeWeightInt >= actualWeight) {
                    $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(volumeWeightInt);

                } else {


                    var actot = parseFloat(actualWeight - volumeWeightInt);
                    // alert(actot);
                    if (actot < 0.501) {


                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(volumeWeightInt) + 0.5);
                    } else {
                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(actualWeight + 0.5));

                    }


                }

            } else {

                if (volumeWeightInt >= actualWeight) {
                    $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(volumeWeightInt);

                } else {


                    var actot = parseFloat(actualWeight - volumeWeightInt);

                    if (actot < 0.999) {
                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(volumeWeightInt) + 1);
                    } else {
                        $("#docket_docket_items_attributes_" + dataid + "_chargeable_weight").val(Math.round(actualWeight + 1));

                    }


                }
            }

        }


